import { StyledHeader } from "../styles/Header.styled";
export default function Header() {
    return (
        <StyledHeader className="header row pt-4 pb-3 px-5">
            <div className="col-3">
                <h4 className="logo">Melissa</h4>
            </div>

            <div className="col-6">
                <h4 className="logo">Melissa</h4>
                <h4></h4>
            </div>
            <div className="col-3">
                <h4>Melissa</h4>
            </div>

        </StyledHeader>
    );
};
